import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

import firebase from 'firebase/app';

// For Firebase JS SDK v7.20.0 and later, measurementId is optional
const firebaseConfig = {
  apiKey: "AIzaSyDy3YokTVD-7kAdjMW-zlnqpx1lXtSL5_s",
  authDomain: "portfolio-8fd78.firebaseapp.com",
  projectId: "portfolio-8fd78",
  storageBucket: "portfolio-8fd78.appspot.com",
  messagingSenderId: "456314077012",
  appId: "1:456314077012:web:913310c8b6ec1270f9d2c1",
  measurementId: "G-G9RDF1VFK3"
};

if(!firebase.apps[0]) {
  firebase.initializeApp(firebaseConfig);
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
